import Card from '../Card/Card';
import { CardContainer} from './styledComponents';

export default function Cards( {characters} ) {  //puedo poner dentro del parentesis {characters} y es lo mismo que el const
    //const {characters} = props;
    const onClose = () => window.alert("Emulamos el cierre de la card");
    return (
        <div>
            {characters.map( ( {name, species, gender, image}) => {
                return (
                    <Card
                        name={name}
                        species= {species}
                        gender= {gender}
                        image= {image}
                        onClose = {onClose}
                />
                );
            })}
        </div>
    );
}
